ialog -->\r\n        </tab>\r\n    </tabset>\r\n</p-dialog><!-- /.modal -->\r\n\r\n<p-dialog *ngIf=\"viewActive\" header=\"Excluded Nodes\" [(visible)]=\"showPopupMessage\" [style]=\"{ width: '35rem' }\">\r\n    <span class=\"text-surface-500 dark:text-surface-400 block mb-8\">The following nodes didn't contain a sequence and were omitted from Alignment View.</span>\r\n    <ol>\r\n        <li *ngFor=\"let node of nodesWithoutSeq\">Node index: {{ node.index }}, ID: {{ node.ID }} </li>\r\n    </ol>\r\n</p-dialog>\r\n";

